INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("プリンセスなプリンなの\nお店にあったいろんな食べもの\nを入れられるだけ入れてみたの\nどんな味なのか楽しみなの", "ペコリーヌのプリン", 5, "おいしすぎて食べ始めたら\n止まらない最高のプリンなの\n今のミヤコを止められるヤツは\n誰もいないの", "やばいですね☆なの！", 1, 100, 1, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("いつもオマエのそばに寄りそう\nヤツのぷりんなの。ミヤコの\nワガママもやさしく受け入れて\nくれそうなの", "コッコロのプリン", 5, "なんだかすごくやさしい気持ち\nになる味なの…\nおはようからおやすみまで\nずっと一緒な味なの…", "主さま、なの！", 1, 101, 2, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("ツンツンデレデレなヤツの\nプリンなの。砂糖とスパイスを\n混ぜてみたの。どんな味になる\nか楽しみなの", "キャルのプリン", 5, "いろんな味が一度で楽しめる\nプリンなの。ツンデレはプリン\nにするとおいしいの。ミヤコも\nツンデレを目指してみるの", "ぶっ殺すぞ！なの！\n…デレデレはどこなの？", 0, 102, 3, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("オマエと同じで、一度赤ちゃん\nみたいになったヤツのプリン\nなの。ヒンヤリ、プリンアイス\nにしてみたの", "シェフィのプリン", 5, "あったかいところで食べる\nプリンアイスは最高なの～♪\n安心しすぎて昔の記憶のない\nミヤコも心が子どもになるの～", "おにーたん♪なの！", 1, 103, 4, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("イリヤを見てたら思いついた\nトマトジュースが隠し味の\nプリンなの。栄養満点なの", "イリヤのプリン", 5, "トマトで栄養補給も完璧なの\nどんどん力がみなぎってきて\n復活も夢じゃないの\nミヤコが復活したら…", "ハーハッハッハ！\n世界征服なのじゃなのー！", 1, 104, 5, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("アカリのプリンなの。ヨリと\n同じくらいかわいく作って\nやったの。正直ミヤコは\nおいしければなんでもいいの", "アカリのプリン", 5, "見た目がかわいくてもミヤコは\n味にも厳しいの。あむっ…\nこ、これは…！なんだかすごく\n変な気分になってきたの…", "お兄ちゃんのエッチ！　なの！", 1, 105, 6, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("かわいくつくらないとアカリが\n怒りそうだからヨリのプリンは\nかわいく作ったの。自信作なの", "ヨリのプリン", 5, "んむぅ…これはなかなか感想が\n難しいプリンなの…率直に言い\nたいような…心のうちに秘めて\nおきたいような…", "えっと…その…あんたのこと…\nだ、大っ嫌いなのーー！", 1, 106, 7, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("シノブはいつもミヤコに\nやさしくしてくれるから\n丁寧に作ったの。ドクロ親父は\nいらないから作ってないの", "シノブのプリン", 5, "このプリンを食べるとシノブが\nミヤコの中にいるみたいなの！\nシノブの力があれば未来の\nプリンを見放題なの！", "お父さん…\nいいかげんにしてなの！\nん？プリンの未来は…\n見えなかったの…", 0, 107, 8, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("黒い鎧を脱がないヤツのプリン\nなの。固めのプリンを目指したら\nカチカチになりすぎたの", "ジュンのプリン", 5, "固すぎてかじれないから丸吞み\nにしたの。なんだか体が硬く\nなった気がするの。みんなを\n守れる気がするの！", "インフェルノシールド！なの！", 1, 108, 9, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("オマエをいっつもからかってる\nヤツのプリンなの\nちょっぴり変わったスパイスで\nからかいを表現したの", "トモのプリン", 5, "口の中でスパイスがプチプチ\nはじけて新食感なの！\nプチプチがミヤコを\n翻弄するの！", "あなたといると調子が狂うな\n…なの\n翻弄してたのはオマエなの？", 1, 109, 10, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("王宮騎士団にいるちっこいヤツ\nなの。ちっこいけどやるヤツ\nらしいから、濃いめの味付けに\nしてみたの", "マツリのプリン", 5, "ん～見かけによらず濃厚な\nパンチのある味わいが\n口いっぱいに広がるの！", "タイガーヒーローボンバー！\nなの！", 1, 110, 11, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("なんかすごくクールなプリンなの\nなんかテンションも少し\n低そうなの。これ\n食べちゃっても大丈夫なの？", "クロエのプリン", 5, "クールな見た目なのにとっても\n優しい味なの！なんだか\n懐かしさを感じるの…", "ま、いいんじゃん？\nしらんけどなの", 1, 111, 13, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("きれいにデコれたの！\nカラフルでおいしそうなの\nこれは期待できそうなの", "チエルのプリン", 5, "なんか変わった食感なの…\nちゃる…ちょる…ちぇる？\nちぇるってしてるの\nでもちぇるってなんなの？", "ぷりーん★なの！", 1, 112, 14, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("見た目は完ぺきなの！\nこれをつくったやつは\nきっと天才なの！\n早く食べたいの！", "ユニのプリン", 5, "味はなんか妙に\n甘酸っぱいの…\n食べたことない味なの\nこの味ってもしかして…", "端的に換言すれば\n青春の味なの？", 1, 113, 15, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("オマエから聞いた懐かしい\n味ってヤツを全部入れてみたの\nオマエ記憶がないのに懐かしい\nってどういうことなの？", "サレンのプリン", 5, "ミヤコも幽霊になる前の記憶\nがないのに、なんだか懐かしい\n気持ちになってくるの…", "幼なじみはあんた…なの？", 1, 114, 16, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("たまたま会ったメイドに教えて\nもらった作り方なの。メイドは\nプリンも作れるはずなの。\nなのにこの不安は何なの…？", "スズメのプリン", 5, "おかしいの。このプリンを\n食べてから、３回も転んだの\nミヤコは幽霊だから転んだり\nしないの。なんでなの…？", "ひゃああんなの～！", 1, 115, 17, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("怖がりな子どもが教えてくれた\n小さくてかわいいプリンなの　\n触ってないのにぷるぷる震える\n驚きのやわらかさなの", "クルミのプリン", 5, "甘さのなかに少しのしょっぱさ\nクセになる味なの\nこのプリンはがんばればきっと\nいろんな美味しいになれるの", "サルキデバレヤ！なの！", 0, 116, 18, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("くまのぬいぐるみを見ていたら\nひらめいたの。小さいけど\nしっかりした甘さの元気に\nなれるプリンなの！", "アヤネのプリン", 5, "このプリン、食べるとなんだか\nお姉ちゃんになった気分に\nなるの。ピンチのプリンは\nミヤコが守ってやるの！", "プリンフルスイングなの～！", 1, 117, 19, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("マホマホ王国って国にいる\nお姫様のプリンなの\n魔物も虜にしちゃう\nすてきなプリンなの", "マホのプリン", 5, "メルヘンパワーがあふれてきて\nいまならミヤコにも魔法が\n使える気がするの！\nほな、いきまひょ～なの！", "みらくるみやりん\nくるりんぱ～☆なの！", 1, 118, 20, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("カッコいいプリンを目指して\nワイルドなものをガンガン\n入れてみたの。きっと熱い\nプリンができるはずなの", "マコトのプリン", 5, "うおーん！ミヤコなんだか\n強くなった気がするの！\n困ったことがあればミヤコが\nまとめて面倒見てやるの！", "ウルフェンバイトなの！", 1, 119, 21, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("どっかの国でよくとれる\nゴーヤーに似てるやつを\nいれてみたの！ちょっと\n苦いらしいけど…", "カオリのプリン", 5, "一口食べたら元気が\nあふれて止まらないの！\n気分がいいから、一曲\n踊りでも披露してやるの！", "なんくるないさ～！なの！", 1, 120, 22, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("勘の鋭いやつが好きな食べ物を\nたくさん入れてみたの\n難しいこと考えるのにぴったり\nらしいけど、なんでなの？", "カスミのプリン", 5, "むむむ…なるほどなの\n上質な糖分をふんだんに\n使うことで、脳をより活性化\nできるからなの！", "ふふん。簡単な推理なの", 1, 121, 23, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("搾りたての牛乳を\nたっぷり使ったプリンなの～\nマヒルに手伝ってもらって\nミヤコ直々に搾ってきたの！", "マヒルのプリン", 5, "ミルクがとっても濃厚で\nほっぺたが落ちちゃうの～♪\nこのプリンからは牧場の…\n自然の息吹を感じるの！", "エリザベス～！なの～！", 1, 122, 24, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("マヒルからやさしいヤツだって\n聞いたの。やさしさを表現\nするために奥ゆかしい甘さに\n仕上げてみたの", "シオリのプリン", 5, "ほのかな甘さでありながら\nしっかりとした主張も\n感じさせる\n味わい深いプリンなの", "私の好きな本…読んで\nもらえたらうれしいです…\nなの", 1, 123, 25, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("牧場にいるヤツらしいの\n牛とは違うらしいの\nもふもふ気持ちいいらしいから\n食感にこだわって作ったの", "リマのプリン", 5, "こ、これは…！口の中に入れた\n瞬間にふんわり溶けて\nなくなっちゃうの！\nその食感がやみつきなの！", "もふもふにしてあげるなの！", 1, 124, 26, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("いっつも寝てるやつらしいの\nぐっすり眠れる薬草をたくさん\n入れてみたの。プリンとして\nおいしくなるかはわからないの", "リンのプリン", 5, "んむぅ…評価が難しい味なの…\nおいしいのはおいしいの…\nん～考えてたら…\n眠くなってきたの…", "めんどくさいな～なの…", 0, 125, 27, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("クレープ屋の真っ赤な人に\n教わったプリンなの\n作り方を丁寧に教えてくれて\nとっても優しい人だったの！", "ラビリスタのプリン", 5, "プ…プリンなのにクレープの味\nがするの。味もすごく普通なの\nでも…なんだかプリンの新しい\n扉を開けそうな気がするの…！", "プリンの権能を解放するの～！", 1, 126, 28, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("お店に落ちてた謎のレシピの\nプリンなの。レシピの表紙には\n『お姉ちゃんの愛情たっぷり』\nって書いてあったの", "シズルのプリン", 5, "とろける食感が絶品なの～♪\n食べるとなんだか幸せな\n気持ちになれるの…これが\n愛情ってやつなの？", "お姉ちゃんパワー全開！なの！", 0, 127, 29, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("リノから作り方を教わったの！\nさすがクレープ屋で働いてる\nだけあって美味しそうなの！", "リノのプリン", 5, "これで妹力？があがるらしいの。\n妹になればお兄ちゃんに\nプリンをたかり放題なの！\n最高なの～！", "お兄ちゃん、プリンをよこすの！", 1, 128, 30, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("プリンのレシピで悩んでたら\n通りすがりのおねーさんが\n一緒に考えてくれたプリンなの\nいいヤツもたまにはいるの～♪", "ヒヨリのプリン", 5, "食べたら元気が湧いてくるの\nだからプリンのレシピのお礼に\nミヤコも人助けを手伝って\nやったの。ミヤコはえらいの！", "困った時はお互いさまさま！\nなの！", 1, 129, 31, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("ミヤコががんばって作った\nこだわりのプリンなの～\nプリンは癒しなの。だから優しい\n気持ちで丁寧に作ったの", "ユイのプリン", 5, "はっ…思わずお花畑が見えたの\n身も心も包まれるような\nとっても優しい味がするの\nこれは…まさに癒しなの～♪", "フラワリングヒールなの～♪", 1, 130, 32, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("究極のプリンを作るため\nミヤコは厳しい修行をしたの…\nその結果あって完成した\nクールで完璧なプリンなの！", "レイのプリン", 5, "確かに完璧なプリンなの\nでも究極のプリンと呼ぶには\nまだまだ修行が必要なの…\nプリン作りは奥が深いの…！", "スラッシュテンペスト！なの。", 1, 131, 33, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("豪華で高級な\nお嬢様プリンなの\n中には宝石みたいな\n大きいイチゴを入れるの！", "アキノのプリン", 5, "味にも素材にもこだわりが\nあるの。一流は妥協しないの\nもっと豪華に、もっとおいしく\nできるはず…", "おーほっほほほ！なの！", 1, 132, 34, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("外はしっかり、中はふわとろの\nプリンにするの\n泡みたいなしゅわしゅわの\n生クリームも入れるの♪", "ユカリのプリン", 5, "プリンは飲み物とも言うの\nぐいっていってみるの\n…ふわしゅわでとろけるの～！\n体に染みわたるの～", "プリしゅわ最高～！なの！", 1, 133, 35, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("餡子を入れて\nオーブンでこんがり焼くの\nたい…焼きプリンなの\n斬新なの！", "タマキのプリン", 5, "このプリンは焼きたてのうちに\n食べるのが一番なの…！\n熱いけどおいしくて\nうずうずしてきたの…！", "にゃにゃにゃ！なの！", 1, 134, 36, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("栄養バランスを考えて\n木の実をたくさん入れるの\nあれこれ忙しいときでも\n頼りになるプリンなの！", "ミフユのプリン", 5, "プリンはいつでも手軽に\n食べられるのも魅力なの\nこれは食べ応えもあるから一つ\n食べればいっぱい動けるの", "効率全開！なの！", 0, 135, 37, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("エルフの森で子どもにもらった\n薬草を使って作ったの\nこんな優しい味のプリンは\n初めてなの…", "ミサトのプリン", 5, "このプリンを食べてから\nいい子になった気がするの\n大好きなプリンを泣いてる子に\nあげたの。いい気分なの", "あらあら～なの～♪", 1, 136, 38, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("お昼寝でみた夢の中に\nでてきた不思議なプリンを\n作ってみたの。見てたらまた\n眠くなってきたの…", "ハツネのプリン", 5, "あまいプリンが口の中で\nぽんぽん弾ける未知の味なの！\n今なら不思議な力で世界も\n救えそうなの！でも眠くなるの…", "スヤスヤ～…なの…", 1, 137, 39, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("お店のはしっこに一つだけ\n残ったおもちゃを見て思い\nついたの。他のプリンと一緒に\n置いておくと震えだすの", "アオイのプリン", 5, "知らないうちにはしっこに\n隠れちゃってたの。食べたら\nミヤコ、シノブたちに会いに\nいきたくなってきたの", "ぼっちは卒業なの～！", 1, 138, 40, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("トップオブアイドルの\nプリンなの。キラキラした\nものを入れて、あつ～い\nオーブンで焼いてみたの", "ノゾミのプリン", 5, "口の中に華やかな甘さが\n広がる…これがアイドルなの？\n急に歌って踊りたく\nなってきたの！", "リズムあげるのー！", 1, 139, 41, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("ミヤコにプリンをくれるすごく\nいいヤツのプリンなの\n精霊に呼びかけながら\n一生懸命かき混ぜたの", "チカのプリン", 5, "プリンの生地がとっても\nなめらかで最高の舌触りなの！\n精霊、ミヤコのプリンのために…", "風の加護を！なの！", 1, 140, 42, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("歌って踊って衣装も作れるヤツ\nのプリンなの。このプリンは\nきれいに包装するの。プリンを\n最高の形で着飾らせるの", "ツムギのプリン", 5, "包装は食べるまでの手間が\n増えてめんどくさいの。でも\nそのめんどくささもプリンの\n味を引き立てるの", "騎士さんのために\nしたんじゃありません！なの！", 1, 141, 43, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("プリンをくれないならどうでも\nいいヤツなの。でも横で\nいろいろ言ってきたから\nがんばって作ったの", "クリスティーナのプリン", 5, "んむっ！？\nく、口のなかでプリンの\nおいしさが大暴れなの！\n止まらないの！", "宴の始まりなの！", 0, 142, 12, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("大人な甘さ控えめのプリンを\n作るの。試しにお魚を入れて\nみるの。プリンの可能性は\n無限大なの！", "ルカのプリン", 5, "大人の味なの。今やミヤコは\nみんなの頼れる姐御なの！\n悪さするやつはミヤコが\n許さないの！", "一刀両断、覚悟しな！なの！", 1, 143, 44, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("サイカワサイツヨな\n魔法のプリンなの\n中身をカラフルにするの～\n甘いプリンは頭が冴えるの！", "ナナカのプリン", 5, "一口食べる度に味が変わって\n魔法みたいなの！\nもしかして全部食べたら\nミヤコも魔法少女になれるの？", "きゅぴーん！キタコレ！なの！", 1, 144, 45, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("小難しい言葉をささやきながら\n作ったら魔力あふれるプリンが\n爆誕したの！でも、不思議と\nイタイタしいのはなぜなの～？", "アンナのプリン", 5, "一口食べたら謎の組織に\n狙われたり、前世の記憶が蘇る\n気がするの～設定盛りすぎなの\nミヤコは、ミヤコは…", "人呼んで、疾風のミヤコなの！", 1, 145, 46, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("甘酸っぱい赤い木の実を\n切り刻んで入れるの\n甘くてちょっぴり刺激的な\nヤンデレのプリンなの", "エリコのプリン", 5, "なんか普通のプリンよりも\nいい匂いがするの～…\nプリンのことがもっともっと\n好きになっちゃうの…", "クスクス…クスクスクス…なの", 1, 146, 47, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("健康に気を遣うミヤコは\nプリンにお薬を入れてみたの～\nでもなんだか毒々しいから\n彩りにバラを添えてみたの～", "ミツキのプリン", 5, "鼻に抜ける薬のにおいがアレ\nだけど大人っぽくて頭が\nよくなった気がするの。無性に\n実験したくてしかたないの", "どんなプリンも\nミヤコの隻眼からは\n逃れられないの～！", 1, 147, 48, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("小さいけどしっかりした\n軍人のプリンなの\nちょっと固めにして\n砂糖はいっぱい入れるの", "モニカのプリン", 5, "ん～王道なプリンは\n甘くて安定したおいしさなの～\n思わず笑顔になっちゃうの\nにこにこなの～♪…はっ！", "私は子どもではない！なの！", 1, 148, 49, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("オーエド町で手に入れた素材と\nトーゴクに伝わる術をかけて\nプリンを作るの。シュババ！\n忍法隠し味の術なの！", "ニノンのプリン", 5, "このプリンを食べてから\n誰かにお仕えしなきゃ\nいけない気がするデースなの\nそれはショ、ショー…", "ショーグン！　ミヤコと一緒に\n天下統一するデースなの！", 1, 149, 50, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("オマエが持ってきた手錠を\nヒントに作ったプリンなの\nプリンが動けないように\nカチカチに固めたの", "クウカのプリン", 5, "カチカチに固めたせいで食感が\nプリンのようで\nプリンじゃないの…でもこの\nもどかしさが癖になるの…", "…ぐふふ、じゅるり～なの", 0, 150, 51, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("とっても美しいプリンなの\n美しいものを手当たり次第\n入れたらすごいことになったの", "ユキのプリン", 5, "味も美しい以外の感想が\n出てこないの。ていうかこれを\n食べたミヤコも美しいの！\n鏡、鏡はどこなの！", "あぁ、ミヤコはなんて美しいの～", 1, 151, 52, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("知らないうちにお菓子が売れた\n時に思いついたプリンなの。\n作り方もよく覚えてない…\nけど、きっとおいしいの！", "アユミのプリン", 5, "うん、やっぱりおいしく…\nん？あそこにいるのは\nアイツなの。あれ？\n体が勝手にアイツの方に…", "ジー…ってミヤコなにしてるの\nミヤコはストーカーじゃないの！", 0, 152, 53, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("イタズラ好きの手下と一緒に\n作ったプリンなの。見た目は\nかわいいけど、作り方は\n意外と複雑なの～", "ミソギのプリン", 5, "見た目通り甘々で優しい味なの\nでも、レシピを見たら裏面に\n別の作り方が書いてあるの。\nこれだと激辛プリンに…", "にひひ…イタズラの時間なの！", 0, 153, 54, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("素直でやさしい手下と一緒に\n動物のぬいぐるみをいっぱい\n並べて作ったの", "ミミのプリン", 5, "ん～、ふわふわの甘々なの！\nなんだか楽しくなって\n心も体もるんたったしてくるの", "ぴょんぴょこぴょーん、なの♪", 0, 154, 55, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("幽霊を怖がっている手下と\n一緒に作ったプリンなの。\n小さいクセにきっちりしてて\nとってもかわいいプリンなの", "キョウカのプリン", 5, "ひんやりしてて暑い日でも\nおいしく食べられそうなの！\nん？これを買いたい大人が\nいる？それって…", "へんたいふしんしゃさんなの！", 0, 155, 56, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("カリスマモデルなプリンなの\nモリモリにデコレーションして\nカリスマ感を演出したの", "スズナのプリン", 5, "見て食べて楽しめる新機軸の\nプリンなの。ミヤコは幽霊\nだけど自分の足でランウェイを\n歩きたくなってきたの！", "ハート狙い撃ち！なの！", 1, 156, 57, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("学校の先生をしてるヤツの\nプリンなの。お堅くしようと\nしたら、いつの間にか色っぽく\nなっちゃったの。なんでなの？", "イオのプリン", 5, "プ、プリンは全部ミヤコのもの\nなのに、なんだかこのプリンは\nいろんな人に教えたく\nなっちゃう不思議な味なの！", "授業を始めます♪なの！", 0, 157, 58, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("少し背伸びしたおませな子を\n表現したプリンなの。あえて\n甘さ控えめなの。カラメルは\n後乗せできるから安心するの", "ミサキのプリン", 5, "ミヤコはプリンならどんなもの\nでも食べるの。でもカラメルを\nちょっとだけ足すの。\nちょっとだけなら…", "立派なレディ、なの！", 1, 158, 59, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("謎に包まれたプリンができたの\n何か隠してるようなの…\nこれは危険なプリンなの！", "ホマレのプリン", 5, "味はすごいゴージャスなの！\nボスの風格があるの！\nビッグなミヤコに\nプリンを捧げるの！", "プリンを持ってこないと\nお仕置きだよ～☆なの！", 1, 159, 60, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("ワイルドな見た目なの！\nこれは期待できそうなの。\nきっと躍動感あふれる味なの！", "カヤのプリン", 5, "最初の一口目が\nすごいインパクトなの！\n無性にケンカしたくなるの！\nプリンをよこせなの！", "たぎってきたの！", 1, 160, 61, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("なんか見た目がパッとしないの\nこれほんとに大丈夫なの？\nなんか頼りないの…", "イノリのプリン", 5, "見た目はアレだけど味はおいし\nいの…あと主張もはっきりして\nるの！やる気と自信だけは\n出てきたのうおおおーなの！", "下剋上、やってやるですなの！", 0, 161, 62, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("天下の大悪党のプリンなの\nこれまでのジョーシキに\n捉われないプリンを\n作ってみたの～", "ムイミのプリン", 5, "むむむ…食べたら\nやる気が湧いてきたの！\nミヤコを邪魔するやつはみんな\nまとめてぶっ飛ばしてやるの～", "どけどけ～！なの～！", 1, 162, 63, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("いろんなものに変身したり\n分身したりできるヤツの\nプリンなの。型で同じプリンを\nたくさんたくさん作ったの", "ネネカのプリン", 5, "いつのまにか作ったの全部\n食べちゃったの。なんで\nプリンは分身しないの？\n無限に増えろなの！", "ミラーミラー！なの！", 1, 163, 64, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("金の亡者のプリンなの\n金にものを言わせて作って\nみたの。おばあちゃんの\nプリンと対極なの", "クレジッタのプリン", 5, "むぅ…認めたくないけど\nおいしいの…これを何個も\n作れるほどのお金を稼ぐのは\n大変なの…でもおいしいから…", "プリンに忠誠を誓いますわ！\nなの！", 1, 164, 65, 3);
INSERT INTO `v1_f4dcd4fd02a18fe7fa10572e594bba218598b1b5481a128fbe1cf5202c9e75e0` VALUES ("みんなお世話になるギルド\n管理協会職員のプリンなの\nお役所感を出すために手堅く\n王道に作ったの", "カリンのプリン", 5, "手堅い…！手堅いの…！\n隙のないプリンなの！\n今のミヤコなら完璧な\n書類作成ができそうなの！", "ギルド管理協会へようこそ！\nなの！", 1, 165, 66, 3);
